// Custom

import Asset_default_logo from '../Assets/Logos/FarmHero.svg'
import Asset_white_logo from '../Assets/Logos/FarmHeroWhite.png'
import Asset_black_logo from '../Assets/Logos/FarmHeroBlack.png'
import Asset_green_logo from '../Assets/Logos/FarmHeroGreen.png';
import Asset_greenn_logo from '../Assets/Logos/FarmHeroGreenn.png';
import Asset_greenalt_logo from '../Assets/Logos/FarmHeroGreenAlt.png';
import Asset_graph from '../Assets/SellerIcons/graph.jpg'


import Asset_background from '../Assets/SellerIcons/back.jpg';


//  Seller Icons 

import Asset_Star from '../Assets/SellerIcons/FHAssets-12.svg'
import Asset_Card from '../Assets/SellerIcons/FHAssets-13.svg'
import Asset_Court from '../Assets/SellerIcons/FHAssets-14.svg'
import Asset_Forward from '../Assets/SellerIcons/FHAssets-15.svg';
import Asset_Transact from '../Assets/SellerIcons/FHAssets-16.svg';
import Asset_Correct from '../Assets/SellerIcons/FHAssets-17.svg';
import Asset_Wrong from '../Assets/SellerIcons/FHAssets-18.svg';
import Asset_Down from '../Assets/SellerIcons/FHAssets-19.svg';
