import Asset_Share from '../Assets/SellerIcons/FHAssets-22.svg';
import Asset_fullStar from '../Assets/SellerIcons/FHAssets-23.svg';
import Asset_Bars from '../Assets/SellerIcons/FHAssets-29.svg';
import Asset_Cart from '../Assets/SellerIcons/FHAssets-30.svg';  
import Asset_Market from '../Assets/SellerIcons/FHAssets-31.svg';  
import Asset_Loader from '../Assets/SellerIcons/FHAssets-32.svg';  
import Asset_File from '../Assets/SellerIcons/FHAssets-33.svg';  
import Asset_More from '../Assets/SellerIcons/FHAssets-34.svg';  
import Asset_Write from '../Assets/SellerIcons/FHAssets-35.svg';  
import Asset_Delete from '../Assets/SellerIcons/FHAssets-37.svg';  

// General Icons
import Asset_Search from '../Assets/GeneralIcons/FHAssets-01.svg';
import Asset_Notification from '../Assets/GeneralIcons/FHAssets-02.svg';
import Asset_Profile from '../Assets/GeneralIcons/FHAssets-03.svg';
import Asset_Arrow from '../Assets/GeneralIcons/FHAssets-04.svg';
