import Asset_Car_Fifteen from '../Assets/FleetIcons/FHAssets-55.svg';
import Asset_Car_Sixteen from '../Assets/FleetIcons/FHAssets-56.svg';

//Product Images

import Avocado from '../Assets/ProduceImages/Avocado.png'
import Banana from '../Assets/ProduceImages/Banana.png'
import Beets from '../Assets/ProduceImages/Beets.png';
