import Sorghum from '../Assets/ProduceImages/Sorghum.png';
import Yam from '../Assets/ProduceImages/Yam.png';
import CashewNuts from '../Assets/ProduceImages/CashewNuts.png';





const Logo = {
    Asset_default_logo ,Asset_white_logo ,Asset_black_logo ,Asset_green_logo ,Asset_greenn_logo ,Asset_greenalt_logo
}

const Background = {
     Asset_background, Asset_graph
}

const sellerImages = {
     Asset_Star ,Asset_Card ,Asset_Court ,Asset_Forward ,Asset_Transact ,Asset_Correct ,Asset_Wrong ,Asset_Down ,Asset_Print ,Asset_Share ,Asset_fullStar ,Asset_Bars ,Asset_Cart ,Asset_Market ,Asset_Loader ,Asset_File ,Asset_More ,Asset_Write ,Asset_Delete
}

const generalIcons = {
     Asset_Search ,Asset_Notification ,Asset_Profile ,Asset_Arrow ,Asset_SecondGrid ,Asset_SecondCart ,Asset_Save ,Asset_Recycle ,Asset_Truck ,Asset_Setting ,Asset_Close ,Asset_Cedi ,Asset_Calender ,Asset_Market2 ,Asset_Clock ,Asset_Location ,Asset_Container ,Asset_Grid ,Asset_Menu ,Asset_Add
}

const fleetIcons = {
     Asset_Car_One ,Asset_Car_Two ,Asset_Car_Three ,Asset_Car_Four ,Asset_Car_Five ,Asset_Car_Six ,Asset_Car_Seven ,Asset_Car_Eight ,Asset_Car_Nine ,Asset_Car_Ten ,Asset_Car_Eleven ,Asset_Car_Twelve ,Asset_Car_Thirteen ,Asset_Car_Fourteen ,Asset_Car_Fifteen ,Asset_Car_Sixteen }

const productImages = {
     Avocado, Banana, Beets, Cassava, Cocoyam, Cowpea, Maize, Mango, Orange, Potato, Sorghum, Yam, CashewNuts
}
     export {sellerImages, Logo, generalIcons, Background, fleetIcons, productImages}
